import React from 'react';
import { Router, Route, Routes } from 'react-router-dom'


const App = () => {
  return (
    <Routes>
      <Route exact path="/" element={<Register/>} />
      <Route exact path="/login" element={<Login/>} />
    </Routes>
  );
};

export default App;
